import { Col, Container, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function SearchBar() {
  return (
    <Container>
      <Col className="border border-dark">
        <h1>Serach Bar</h1>
        <p>Random Text</p>
      </Col>
    </Container>
  );
}

export default SearchBar;
